$(document).ready(function(){$(".carousel").carousel();let n=n=>n.trim().length===0?undefined:n,t=new Vue({el:"#tabContent",data:{searchEntries:{entries:[],pages:0}},mounted:function(){this.categoriesCallback(1);$(".onChangeCallback").change(()=>this.categoriesCallback(1));$("#searchInput").keypress(this.searchCallback)},methods:{categoriesCallback:function(t){let i=this;axios.get(util.apiUrl("/api/getQuizList",{page:t,size:global.quizCardAmount,type:"category",difficulty:$("#difficultySelect option:selected").attr("value"),categoryIndex:$("#categorySelect option:selected").attr("value"),orderBy:$("#orderBySelect option:selected").attr("value"),search:n($("#searchInput").val())})).then(function(n){i.searchEntries.entries=n.data.entries;i.searchEntries.pages=n.data.pages})},searchCallback:function(n){n.keyCode===13&&this.categoriesCallback(1)}}})});